pragma solidity ^0.5.0;

import "./IERC20.sol";
import "./Ownable.sol";
import "./SafeMath.sol";

/**
 * @title Whitney token
 * @dev ERC20 compatible token which requires an external oracle to explicitally
 * aprove transactions for them to be executed.
 *
 * Useful to have an external agency to verify the legal validity of transactions
 */
contract WhitneyToken is IERC20, Ownable {

    /**
     * @dev Initializes the contract setting the deployer as the initial owner.
     */
    constructor (uint256 totalSupply, uint8 decimals,
        string memory name, string memory symbol)
        public Ownable(_msgSender())
    {
        _totalSupply = totalSupply;
        _balances[_msgSender()] = totalSupply;
        _decimals = decimals;
        _name = name;
        _symbol = symbol;
    }

    /**
     * @dev Emitted when the owner confirms a transaction and it's successfully state
     */
    event Confirmation(address indexed sender, uint indexed transactionId);
    /**
     * @dev Emitted when the owner denies a transaction and the funds are sent back to the user
     */
    event Rejection(address indexed sender, uint indexed transactionId, uint[] codeError);
    /**
     * @dev Emitted when the token owner submits a transaction for approval
     */
    event Submission(uint indexed transactionId);

    event Remint(address indexed oldAddress, address indexed newAddress, uint256 balance);

    using SafeMath for uint256;

    mapping (address => uint256) internal _balances;

    mapping (address => uint256) internal _lockups;

    mapping (address => mapping (address => uint256)) internal _allowances;

    uint256 internal _totalSupply;

    uint8 internal _decimals;

    string internal _name;

    string internal _symbol;

    mapping (uint256 => Transaction) internal _transactions;

    uint256 internal _transactionCount;

    enum transactionState { Submited, Confirmed, Rejected }

    /**
     * @dev See {IERC20-totalSupply}.
     */
    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    /**
     * @dev Optional value for standarization with most wallets.
     */
    function decimals() public view returns (uint8) {
        return _decimals;
    }

    /**
     * @dev Optional value for standarization with most wallets.
     */
    function name() public view returns (string memory) {
        return _name;
    }

    /**
     * @dev Optional value for standarization with most wallets.
     */
    function symbol() public view returns (string memory) {
        return _symbol;
    }

    /**
     * @dev function to query for specific transactions.
     */
    function transactions(uint transactionId) public view returns (address, address, uint, transactionState) {
        address sender = _transactions[transactionId].sender;
        address recipient = _transactions[transactionId].recipient;
        return (sender, recipient, _transactions[transactionId].value, _transactions[transactionId].state);
    }

    /**
     * @dev function to query for specific transactions.
     */
    function transactionFullData(uint transactionId) public view returns (
        address, address, uint, transactionState, uint256, uint256, uint256, uint256
        ) {
        address sender = _transactions[transactionId].sender;
        address recipient = _transactions[transactionId].recipient;
        return (sender, recipient, _transactions[transactionId].value,
        _transactions[transactionId].state, _balances[sender], _balances[recipient],
        _lockups[sender], _lockups[recipient]);
    }

    /**
     * @dev function to query for specific transactions.
     */
    function totalTransactions() public view returns (uint) {
        return _transactionCount;
    }

    /**
     * @dev See {IERC20-balanceOf}.
     */
    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    /**
     * @dev See {IERC20-balanceOf}.
     */
    function lockupOf(address account) public view returns (uint256) {
        return _lockups[account];
    }

    /**
     * @dev Data structure which represents a whitney transaction, the state is defined
     * as an enum: { Submited, Confirmed, Rejected }
     */
    struct Transaction {
        address sender;
        address recipient;
        uint value;
        transactionState state;
    }


    /**
     * @dev Allows the `owner` of confirm a specific transaction.
     *
     * This function will confirm and execute the original transaction
     *
     * Emits a {Confirmation} event.
     *
     * Requirements:
     *
     * Only the contract owner can execute, contract must not be paused,
     * transaction must exists, transaction must be non-executed
     *
     */
    function confirmTransaction(uint transactionId)
        public
        whenNotPaused
        onlyOwner
        transactionExists(transactionId)
        notProcessed(transactionId)
    {
        _processTransaction(transactionId, transactionState.Confirmed);
        emit Confirmation(msg.sender, transactionId);
    }

    /**
     * @dev Allows the `owner` of deny a specific transaction.
     *
     * This function will confirm and execute the original transaction
     *
     * Emits a {Rejection} event.
     *
     * Requirements:
     *
     * Only the contract owner can execute, contract must not be paused,
     * transaction must exists, transaction must be non-executed
     *
     */
    function rejectTransaction(uint transactionId, uint[] memory codeError)
        public
        whenNotPaused
        onlyOwner
        transactionExists(transactionId)
        notProcessed(transactionId)
    {
        _processTransaction(transactionId, transactionState.Rejected);
        emit Rejection(msg.sender, transactionId, codeError);
    }

    /**
     * @dev See {IERC20-allowance}.
     */
    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowances[owner][spender];
    }

    /**
     * @dev See {IERC20-approve}.
     *
     * Requirements:
     *
     * - `spender` cannot be the zero address.
     */
    function approve(address spender, uint256 amount) public returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    /**
     * @dev See {IERC20-transfer}.
     *
     * Requirements:
     *
     * - `recipient` cannot be the zero address.
     * - the caller must have a balance of at least `amount`.
     */
    function transfer(address recipient, uint256 amount) public whenNotPaused returns (bool) {
        return _whitneyTransfer(_msgSender(), recipient, amount);
    }

    /**
     * @dev See {IERC20-transferFrom}.
     *
     * Emits an {Approval} event indicating the updated allowance. This is not
     * required by the EIP. See the note at the beginning of {ERC20};
     *
     * Requirements:
     * - `sender` and `recipient` cannot be the zero address.
     * - `sender` must have a balance of at least `amount`.
     * - the caller must have allowance for `sender`'s tokens of at least
     * `amount`.
     */
    function transferFrom(address sender, address recipient, uint256 amount) public returns (bool) {
        _whitneyTransfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount,
            "ERC20: transfer amount exceeds allowance"));
        return true;
    }

    /**
     * @dev Atomically increases the allowance granted to `spender` by the caller.
     *
     * This is an alternative to {approve} that can be used as a mitigation for
     * problems described in {IERC20-approve}.
     *
     * Emits an {Approval} event indicating the updated allowance.
     *
     * Requirements:
     *
     * - `spender` cannot be the zero address.
     */
    function increaseAllowance(address spender, uint256 addedValue) public returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    /**
     * @dev Atomically decreases the allowance granted to `spender` by the caller.
     *
     * This is an alternative to {approve} that can be used as a mitigation for
     * problems described in {IERC20-approve}.
     *
     * Emits an {Approval} event indicating the updated allowance.
     *
     * Requirements:
     *
     * - `spender` cannot be the zero address.
     * - `spender` must have allowance for the caller of at least
     * `subtractedValue`.
     */
    function decreaseAllowance(address spender, uint256 subtractedValue) public returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue,
            "ERC20: decreased allowance below zero"));
        return true;
    }

    /** @dev Creates a maximum of 10tx minting an `amount` of tokens and assigns them to `accounts`, increasing
     * the total supply.
     *
     * Emits a {Transfer} event with `from` set to the zero address for each receiver.
     *
     * Requirements
     *
     * - `to` cannot be the zero address.
     */
    function batchMint(address[] memory _receivers, uint256[] memory _values) public onlyOwner whenNotPaused returns (bool) {
    uint nReceivers = _receivers.length;
    uint nValues = _values.length;
    require(nReceivers == nValues, "Number of receivers doesn match number of values");
    require(nReceivers <= 500, "Cannot mint batches bigger than 500");

    for (uint i = 0; i < nReceivers; i++) {
        _mint(_receivers[i], _values[i]);
    }
    return true;
  }
    /** @dev Burns all the tokens from an ccount and mints the same amount of token
     *       to another account
     *
     * Emits a {BurnMint} event with the old address, the new addres and the amount burned & minted.
     *
     * Requirements
     *
     * - None of the addresses can be the zero address.
     */
    function remint(address _oldAddress, address _newAddress, uint256 amount) public onlyOwner whenNotPaused returns (bool) {
        require(_oldAddress != address(0), "Whitney: remint tokens from zero address");
        require(_newAddress != address(0), "Whitney: remint tokens to zero address");
        _balances[_oldAddress].add(_lockups[_oldAddress]);
        _lockups[_oldAddress] = 0;
        _balances[_oldAddress] = _balances[_oldAddress].sub(amount, "Whitney: Remint amount exceeds balance");
        _balances[_newAddress] = _balances[_newAddress].add(amount);
        emit Remint(_oldAddress, _newAddress, amount);
        return true;
    }

    /** @dev Mints `amount` tokens and assigns them to `account`
     *
     * Emits a {Transfer} event with `from` set to the zero address.
     *
     * Requirements
     *
     * - `to` cannot be the zero address.
     */
    function mint(address _receiver, uint256 value) public onlyOwner whenNotPaused returns (bool) {
        _mint(_receiver, value);
        return true;
    }

    /** @dev Burns `amount` tokens`
     *
     * Emits a {Transfer} event with `to` set to the zero address.
     *
     * Requirements
     *
     * - `from` cannot be the zero address.
     */
    function burn(address _from, uint256 value) public onlyOwner whenNotPaused returns (bool) {
        _burn(_from, value);
        return true;
    }

    /**
     * @dev Allows a token holder to submit a transaction for aproval.
     *
     * This function will put the assets on escrow until the transaction is
     * aproved or denied by the owner
     *
     * Emits an {Submission} event.
     *
     * Requirements:
     *
     * - `sender` cannot be the zero address.
     * - `recipient` cannot be the zero address.
     * - `sender` must have a balance of at least `amount`.
     *
     */
    function _whitneyTransfer(address sender, address recipient, uint256 amount) internal returns (bool) {
        _transfer(sender, address(this), amount);
        _addTransaction(sender, recipient, amount);
        return true;
    }

    /** @dev Creates `amount` tokens and assigns them to `account`, increasing
     * the total supply.
     *
     * Emits a {Transfer} event with `from` set to the zero address.
     *
     * Requirements
     *
     * - `to` cannot be the zero address.
     */
    function _burn(address account, uint256 amount) internal {
        require(account != address(0), "ERC20: burns tokens from zero address");

        _totalSupply = _totalSupply.sub(amount);
        _balances[account] = _balances[account].sub(amount);
        emit Transfer(account, address(0), amount);
    }

    /** @dev Creates `amount` tokens and assigns them to `account`, increasing
     * the total supply.
     *
     * Emits a {Transfer} event with `from` set to the zero address.
     *
     * Requirements
     *
     * - `to` cannot be the zero address.
     */
    function _mint(address account, uint256 amount) internal {
        require(account != address(0), "ERC20: mint to the zero address");

        _totalSupply = _totalSupply.add(amount);
        _balances[account] = _balances[account].add(amount);
        emit Transfer(address(0), account, amount);
    }

    /**
     * @dev Performs a token transfer
     *
     * This function will put the assets on escrow until the transaction is
     * aproved or denied by the owner
     *
     * Emits an {Transfer} event.
     *
     * Requirements:
     *
     * - `sender` cannot be the zero address.
     * - `recipient` cannot be the zero address.
     * - `sender` must have a balance of at least `amount`.
     *
     */
    function _transfer(address sender, address recipient, uint256 amount) internal returns (bool) {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        _balances[sender] = _balances[sender].sub(amount, "ERC20: transfer amount exceeds balance");
        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(sender, recipient, amount);
        return true;
    }

    /**
     * @dev Sets `amount` as the allowance of `spender` over the `owner`s tokens.
     *
     * This is internal function is equivalent to `approve`, and can be used to
     * e.g. set automatic allowances for certain subsystems, etc.
     *
     * Emits an {Approval} event.
     *
     * Requirements:
     *
     * - `owner` cannot be the zero address.
     * - `spender` cannot be the zero address.
     */
    function _approve(address owner, address spender, uint256 amount) internal {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    /**
     * @dev Processes a Whitney transfer liberating the escrowed assets.
     *
     * This is internal function processes a transaction submited by the user
     * sets the transaction as processed with it's correct state and sends
     * the escrowed assets back to the user if denied or to the defined
     * sender if confirmed
     *
     */
    function _processTransaction (uint transactionId, transactionState state) internal returns (bool){
        Transaction storage transaction = _transactions[transactionId];
        transaction.state = state;
        _lockups[transaction.sender] = _lockups[transaction.sender].sub(transaction.value);
        if (state==transactionState.Confirmed){
            return _transfer(address(this), transaction.recipient, transaction.value);
        }else{
            return _transfer(address(this), transaction.sender, transaction.value);
        }
    }

    /**
     * @dev Adds a transaction to the Whitney transaction data structure.
     *
     * Creates a transaction, assigns an ID, adds it to the
     * data structure, and updates the total transactions counter
     *
     */
    function _addTransaction(address origin, address destination, uint value) internal
    returns (uint transactionId)
    {
        _lockups[origin] = _lockups[origin].add(value);
        transactionId = _transactionCount;
        _transactions[transactionId] = Transaction({
            sender: origin,
            recipient: destination,
            value: value,
            state: transactionState.Submited
        });
        _transactionCount += 1;
        emit Submission(transactionId);
    }

    /**
     * @dev Throws if transaction doesn't exist
     */
    modifier transactionExists(uint transactionId) {
        require(_transactions[transactionId].recipient != address(0),
            "WhitneyToken: Transaction does not exist");
        _;
    }

    /**
     * @dev Throws if the transaction has already been processed.
     */
    modifier notProcessed(uint transactionId) {
        require(_transactions[transactionId].state == transactionState.Submited,
            "WhitneyToken: Transaction has already been executed");
        _;
    }
}

